import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <h1>ジョセフ　（ＪＭＨＪ)</h1>
      <p>Developer | Future Funk Conoisseur | </p>
      <nav>
        <a href="#about">About</a>
        <a href="#feeds">Feeds</a>
        <a href="#contact">Contact</a>
      </nav>
    </header>
  );
}

export default Header;
